import React from 'react';
import styles from './Section.module.css'
function Section(props) {
    return (
        <section className={styles['section']}>
            <h1>
                {props.title}
            </h1>
            <p>
                {props.description}
            </p>
            {props.childreen}
        </section>
    );
}

export default Section;
